import { Injectable } from '@angular/core';
import { TraitementChelateurReçu } from '../models/TraitementChelateurReçu';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class TreatChelateurService {
  private apiUrl = 'https://localhost:7129/api/TraitementChelateurReçu';

  constructor(private http: HttpClient) { }
  add(TraitementChelateurReçu: TraitementChelateurReçu): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', TraitementChelateurReçu);

    return this.http.post<any>(`${this.apiUrl}/add`, TraitementChelateurReçu, { observe: 'response' });
  }
}
